import React, { Component } from 'react';
import logo from './images/my_logo.PNG'
console.log(logo);

class PageComponent extends Component {
  render() {
    return (
        <div>
            <h1>Web crawler</h1>
            <img src='{logo}' />
        </div>
    );
  }
}

export default PageComponent;
